    [],nt"num_tags": 5,nt"name": "blackwater-national-wildlife-refuge-narrative-report-may-june-july-and-august-1958",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Blackwater NWR
    outlines Refuge accomplishments from May through August of 1958. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, and raptors- is
    also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and vegetation control. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors. Items of interest, N-R
    forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
